import React, { Component } from "react";

const style = {
  container: {
    width: "40%",
    minHeight: "20vh",
    backgroundColor: "#e6e6e6",
    borderRadius: 10,
    display: "flex",
    alignItems: "center",
    flexDirection: "column",
    paddingBottom: 80,
    paddingTop: 50,
    position: "relative"
  },
  center: {
    display: "flex",
    justifyContent: "center",
    width: "100%"
  },
  wrapper: {
    display: "flex",
    justifyContent: "center",
    width: "90%"
  },
  bottomContainer: {
    position: "absolute",
    bottom: -25
  }
};

export class TaskInputField extends Component {
  state = {};
  render() {
    return (
      <div style={style.container}>
        <div>
          <p style={style.text}>{text}</p>
          <h5 style={style.timestamp}>{timestamp}</h5>
        </div>
        <div>
          <LabelFinished />
        </div>
        <div style={style.posAbsolute}>
          <RemoveTaskButton />
        </div>
      </div>
    );
  }
}

export default TaskInputField;
